  `zfb_user_id` varchar(255) DEFAULT NULL COMMENT '支付宝userid',
  `pay_password` varchar(255) DEFAULT NULL COMMENT '支付密码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `id` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=9 DEFAULT CHARSET=utf8;

