/*Table structure for table `ap_withdraw` */

DROP TABLE IF EXISTS `ap_withdraw`;

CREATE TABLE `ap_withdraw` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '提现记录表',
  `user_id` int(11) DEFAULT NULL COMMENT '用户id',
